import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles, Divider } from '@material-ui/core';


let Root = styled.div({
  backgroundColor: 'primary',
  display: 'flex',
  // height: '100%',
  overflow: 'hidden',
  width: '100%',
  paddingTop: "10%"
})
let Wrapper = styled.div({
  display: 'flex',
  flex: '1 1 auto',
  overflow: 'hidden',
  paddingTop: 64,
})
let ContentContainer = styled.div({
  display: 'flex',
  flex: '1 1 auto',
  overflow: 'hidden'
})
let Content = styled.div({
  flex: '1 1 auto',
  height: '100%',
  overflow: 'auto'
})
let Footer = styled.div({
  width: "100%",
  margin: "auto",
  padding: "0 0 1.5rem 0"
})
let Footer_descript = styled.div({
  textAlign: "center",
  fontWeight: 200,
})
let Footer_ment = styled.div({
  padding: 4,
  fontSize: 12
})
let Footer_image = styled.div({
  textAlign: "center",
  marginTop: 20,
  marginBottom: 20
})
const Footer_divider = styled(Divider)({
  marginTop: 50
})


const DashBoardFooterLayout = () => {
  const classes = useStyles();
  return (
    <footer className={classes.footer}>
      <Divider className={classes.footer_divider}/>
      <div className={classes.footer_image}>
        {/* <img src={TobelongLogo} /> */}
      </div>
      <div className={classes.footer_descript}>
        <div className={classes.footer_ment}>제공 서비스 : SOTHECODE_ERP ㅣ 회사명 : SOTHECODe</div>
        <div className={classes.footer_ment}>Disclaimer: All content is provided for fun and entertainment purposes only</div>
        <div className={classes.footer_ment}>ⓒ 2021. 소더코드 .All Rights Reserved.</div>
      </div>
    </footer>
  );
};

DashBoardFooterLayout.propTypes = {
  children: PropTypes.node
};

export default DashBoardFooterLayout;
